import React from "react";
import RecipeCard from "./RecipeCard";

import "../CSS/Home.css";

const recipes = [
  {
    title: "Strawberry Ice Latte",
    imageUrl: "/images/strawberry ice latte.jpg",
    description:
      "A refreshing strawberry-flavored ice latte perfect for the summer.",
  },
  {
    title: "Strawberry Cheesecake",
    imageUrl: "/images/sb_cheeze_cake.jpg",
    description:
      "Creamy and rich strawberry cheesecake that melts in your mouth.",
  },
  {
    title: "Misal",
    imageUrl: "/images/misal.jpg",
    description:
      "A spicy and tangy Maharashtrian dish that is a local favorite.",
  },
  {
    title: "Chicken Biryani",
    imageUrl: "/images/chicken_Biryani.jpg",
    description:
      "Aromatic and flavorful biryani cooked with tender chicken pieces and spices.",
  },
  {
    title: "Chole Kulche",
    imageUrl: "/images/chole_kulche.jpg",
    description: "A popular North Indian dish served with soft kulchas.",
  },
  {
    title: "Seekh Kabab",
    imageUrl: "/images/seekh_kabab.jpg",
    description: "Juicy minced meat skewered and cooked over an open flame.",
  },
  // ... more recipe objects
];

function Home() {
  return (
    <div className="home-container">
      {recipes.map((recipe, index) => (
        <RecipeCard key={index} recipe={recipe} />
      ))}
    </div>
  );
}

export default Home;
